window.bookSummaryJSON = "<p><b>The villain isn’t supposed to be king.&nbsp;</b></p> <p>I have a simple plan.&nbsp;<br> </p> <p>Finish Royal Elite School and get into my dream university.&nbsp;</p> <p>One glance from the school’s king blows my plan up in smoke.&nbsp;<br> </p> <p>One glance and he suffocates my air.&nbsp;<br> </p> <p>One glance and he issues his death sentence.&nbsp;</p> <p>His first words spiral my life into irreparable chaos.&nbsp;<br> “I will destroy you.”&nbsp;</p> <p>Everything about Aiden King is black.&nbsp;<br> </p> <p>Black mind.&nbsp;<br> </p> <p>Black heart.&nbsp;<br> </p> <p>Black soul.&nbsp;</p> <p>I should’ve remained quiet and endured the time I have left.&nbsp;</p> <p>I didn’t.&nbsp;</p> <p>I made the irrevocable mistake of provoking the king on his throne.&nbsp;</p> <p>The devil in his hell.&nbsp;</p> <p>And now, I’ll pay the price.&nbsp;</p> <p>Being hated by Aiden King is dangerous.&nbsp;</p> <p>But being wanted by him is lethal.&nbsp;</p> <p>Deviant King<i> is book one of Royal Elite Series. This is a dark high school bully romance, mature new adult, and contains dubious situations that some listeners might find offensive. Aiden isn’t the normal romance hero. In fact, he’s not a hero at all. So please don’t listen to this if any of that bothers you. </i></p> <p><i>This book is part of a trilogy and is not a stand-alone.</i></p>"; 
